  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Bombay Hook NWR
  outlines Refuge accomplishments from August through October of 1940. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, furbearers, and disease-
  is also covered. The Refuge development and maintenance section discusses physical
  developments and plantings. The public relations section of the report describes
  Refuge visitors. Photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
